    name: string;
    gender: string;
}

const CharacterDataList:CharacterData[] = [
    {
        name: '伊達あやね',
        gender: '女',
    },
    {
        name: '若葉まこと',
        gender: '女',
    },{
        name: '兎鞠まり',
        gender: '女',
    },{
        name: '近所のおじさん',
        gender: '男',
    },{
        name: 'エイリアン',
        gender: '不明',
    },
];

